(23, 'Flutter & Dart - The Complete Guide', 'flutter-and-dart-the-complete-guide', 'Beginner', '1', '<p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; font-size: 14px; max-width: 118.4rem; color: rgb(60, 59, 55); font-family: \"sf pro text\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol\";\">The entire course <strong style=\"margin: 0px; padding: 0px;\">was completely re-recorded and updated </strong>- it\'s totally up-to-date with the latest version of Flutter!</p><p style=\"margin: 0.8rem 0px 0px; padding: 0px; font-size: 14px; max-width: 118.4rem; color: rgb(60, 59, 55); font-family: \"sf pro text\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol\";\">With the latest update, I also added <strong style=\"margin: 0px; padding: 0px;\">Push Notifications</strong> and <strong style=\"margin: 0px; padding: 0px;\">Image Upload</strong>!</p><p style=\"margin: 0.8rem 0px 0px; padding: 0px; font-size: 14px; max-width: 118.4rem; color: rgb(60, 59, 55); font-family: \"sf pro text\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol\";\">---</p><p style=\"margin: 0.8rem 0px 0px; padding: 0px; font-size: 14px; max-width: 118.4rem; color: rgb(60, 59, 55); font-family: \"sf pro text\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol\";\"><strong style=\"margin: 0px; padding: 0px;\">Join the most comprehensive & bestselling Flutter course and learn how to build amazing iOS and Android apps!</strong></p><p style=\"margin: 0.8rem 0px 0px; padding: 0px; font-size: 14px; max-width: 118.4rem; color: rgb(60, 59, 55); font-family: \"sf pro text\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol\";\"><strong style=\"margin: 0px; padding: 0px;\">You don\'t need to learn Android/ Java and iOS/ Swift to build real native mobile apps!</strong></p>', '<p style=\"margin: 0.8rem 0px 0px; padding: 0px; font-size: 14px; max-width: 118.4rem; color: rgb(60, 59, 55); font-family: \"sf pro text\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol\";\">Flutter - a framework developed by Google - allows you to learn one language (Dart) and build beautiful native mobile apps in no time. Flutter is a SDK providing the tooling to compile Dart code into native code and it also gives you a rich set of pre-built and pre-styled UI elements (so called widgets) which you can use to compose your user interfaces.</p><p style=\"margin: 0.8rem 0px 0px; padding: 0px; font-size: 14px; max-width: 118.4rem; color: rgb(60, 59, 55); font-family: \"sf pro text\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol\";\"><strong style=\"margin: 0px; padding: 0px;\">Flutter is extremely trending</strong> and gets used for major Google apps like their Adwords app - it\'s now marked as \"ready for production\", hence now is the time to jump in and learn it!</p><p style=\"margin: 0.8rem 0px 0px; padding: 0px; font-size: 14px; max-width: 118.4rem; color: rgb(60, 59, 55); font-family: \"sf pro text\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol\";\">This course will teach Flutter & Dart from scratch, NO prior knowledge of either of the two is required! And you certainly don\'t need any Android or iOS development experience since the whole idea behind Flutter is to only learn one language.</p><p style=\"margin: 0.8rem 0px 0px; padding: 0px; font-size: 14px; max-width: 118.4rem; color: rgb(60, 59, 55); font-family: \"sf pro text\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol\";\">You\'ll learn Flutter not only in theory but <strong style=\"margin: 0px; padding: 0px;\">we\'ll build a complete, realistic app</strong> throughout this course. This app will feature both all the core basics as well as advanced features like using Google Maps, the device camera, adding animations and more!</p><p style=\"margin: 0.8rem 0px 0px; padding: 0px; font-size: 14px; max-width: 118.4rem; color: rgb(60, 59, 55); font-family: \"sf pro text\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol\";\"><strong style=\"margin: 0px; padding: 0px;\">With Flutter, you\'ll be able to write code only once and ship your apps both to the Apple AppStore and Google Play.</strong></p><p style=\"margin: 0.8rem 0px 0px; padding: 0px; font-size: 14px; max-width: 118.4rem; color: rgb(60, 59, 55); font-family: \"sf pro text\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol\";\">Use Google\'s Material Design to build beautiful, yet fully customizable, apps in no time with almost zero effort. You can use the rich widget suite Flutter provides to add common UI elements like buttons, switches, forms, toolbars, lists and more - or you simply build your own widgets - Flutter makes that a breeze, too.</p><p style=\"margin: 0.8rem 0px 0px; padding: 0px; font-size: 14px; max-width: 118.4rem; color: rgb(60, 59, 55); font-family: \"sf pro text\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol\";\"><strong style=\"margin: 0px; padding: 0px;\">Here\'s what\'s included in the course:</strong></p><ul style=\"margin: 0.8rem 0px 0px; padding: 0px 0px 0px 2.4rem; font-size: 14px; max-width: 118.4rem; color: rgb(60, 59, 55); font-family: \"sf pro text\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol\";\"><li style=\"margin: 0px; padding: 0px 0px 0px 0.8rem;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; font-size: inherit; max-width: 118.4rem;\">Detailed setup instructions for both macOS and Windows</p></li><li style=\"margin: 0.4rem 0px 0px; padding: 0px 0px 0px 0.8rem;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; font-size: inherit; max-width: 118.4rem;\">A thorough introduction to Flutter, Dart and the concept behind widgets</p></li><li style=\"margin: 0.4rem 0px 0px; padding: 0px 0px 0px 0.8rem;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; font-size: inherit; max-width: 118.4rem;\">An overview of the built-in widgets and how you may add your own ones</p></li><li style=\"margin: 0.4rem 0px 0px; padding: 0px 0px 0px 0.8rem;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; font-size: inherit; max-width: 118.4rem;\">Debugging tipps & tricks</p></li><li style=\"margin: 0.4rem 0px 0px; padding: 0px 0px 0px 0.8rem;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; font-size: inherit; max-width: 118.4rem;\">Page navigation with tabs, side drawers and stack-based navigation</p></li><li style=\"margin: 0.4rem 0px 0px; padding: 0px 0px 0px 0.8rem;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; font-size: inherit; max-width: 118.4rem;\">State management solutions</p></li><li style=\"margin: 0.4rem 0px 0px; padding: 0px 0px 0px 0.8rem;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; font-size: inherit; max-width: 118.4rem;\">Handling and validating user input</p></li><li style=\"margin: 0.4rem 0px 0px; padding: 0px 0px 0px 0.8rem;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; font-size: inherit; max-width: 118.4rem;\">Connecting your Flutter app to backend servers by sending Http requests</p></li><li style=\"margin: 0.4rem 0px 0px; padding: 0px 0px 0px 0.8rem;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; font-size: inherit; max-width: 118.4rem;\">User authentication</p></li><li style=\"margin: 0.4rem 0px 0px; padding: 0px 0px 0px 0.8rem;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; font-size: inherit; max-width: 118.4rem;\">Adding Google Maps</p></li><li style=\"margin: 0.4rem 0px 0px; padding: 0px 0px 0px 0.8rem;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; font-size: inherit; max-width: 118.4rem;\">Using native device features like the camera</p></li><li style=\"margin: 0.4rem 0px 0px; padding: 0px 0px 0px 0.8rem;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; font-size: inherit; max-width: 118.4rem;\">Adding beautiful animations & page transitions</p></li><li style=\"margin: 0.4rem 0px 0px; padding: 0px 0px 0px 0.8rem;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; font-size: inherit; max-width: 118.4rem;\">Image Upload</p></li><li style=\"margin: 0.4rem 0px 0px; padding: 0px 0px 0px 0.8rem;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; font-size: inherit; max-width: 118.4rem;\">Push Notifications - manual approach and automated</p></li><li style=\"margin: 0.4rem 0px 0px; padding: 0px 0px 0px 0.8rem;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; font-size: inherit; max-width: 118.4rem;\">How to publish your app to the app stores</p></li><li style=\"margin: 0.4rem 0px 0px; padding: 0px 0px 0px 0.8rem;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; font-size: inherit; max-width: 118.4rem;\">And more!</p></li></ul><p style=\"margin: 0.8rem 0px 0px; padding: 0px; font-size: 14px; max-width: 118.4rem; color: rgb(60, 59, 55); font-family: \"sf pro text\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol\";\"><strong style=\"margin: 0px; padding: 0px;\">This course is for you if ...</strong></p><ul style=\"margin: 0.8rem 0px 0px; padding: 0px 0px 0px 2.4rem; font-size: 14px; max-width: 118.4rem; color: rgb(60, 59, 55); font-family: \"sf pro text\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol\";\"><li style=\"margin: 0px; padding: 0px 0px 0px 0.8rem;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; font-size: inherit; max-width: 118.4rem;\">You\'re interested in building real native mobile apps for the two most popular mobile platforms - iOS and Android</p></li><li style=\"margin: 0.4rem 0px 0px; padding: 0px 0px 0px 0.8rem;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; font-size: inherit; max-width: 118.4rem;\">You want to explore the full set of features Flutter offers</p></li><li style=\"margin: 0.4rem 0px 0px; padding: 0px 0px 0px 0.8rem;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; font-size: inherit; max-width: 118.4rem;\">Don\'t want to spend hours learning two completely different languages</p></li></ul><p style=\"margin: 0.8rem 0px 0px; padding: 0px; font-size: 14px; max-width: 118.4rem; color: rgb(60, 59, 55); font-family: \"sf pro text\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol\";\"><strong style=\"margin: 0px; padding: 0px;\">Course prerequisites:</strong></p><ul style=\"margin: 0.8rem 0px 0px; padding: 0px 0px 0px 2.4rem; font-size: 14px; max-width: 118.4rem; color: rgb(60, 59, 55); font-family: \"sf pro text\", -apple-system, BlinkMacSystemFont, Roboto, \"segoe ui\", Helvetica, Arial, sans-serif, \"apple color emoji\", \"segoe ui emoji\", \"segoe ui symbol\";\"><li style=\"margin: 0px; padding: 0px 0px 0px 0.8rem;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; font-size: inherit; max-width: 118.4rem;\">Basic programming language knowledge will help a lot but is not a hard requirement</p></li><li style=\"margin: 0.4rem 0px 0px; padding: 0px 0px 0px 0.8rem;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; font-size: inherit; max-width: 118.4rem;\">You DON\'T need to know Flutter or Dart</p></li><li style=\"margin: 0.4rem 0px 0px; padding: 0px 0px 0px 0.8rem;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; font-size: inherit; max-width: 118.4rem;\">You DON\'T need to know iOS (Swift/ObjectiveC) or Android (Java)</p></li></ul>', '/uploads/media_manager/19.jpg', 'https://youtu.be/I9ceqw5Ny-4', 'Youtube', '[\"Basic programming language will help but is not a must-have\",\"                                                        You can use either Windows\",\"                                                        NO prior iOS or Android development experience is required\"]', '[\"NO prior Flutter or Dart experience is required - this course starts at zero!\",\"                                                                      Learn Flutter and Dart from the ground up\",\"                                                                       step-by-step\"]', '[\"Flutter \",\"apk\",\"android\",\"ios\"]', 1, NULL, 0, NULL, 'English', '[\"\"]