rly and helpful too!\"&nbsp;<strong style=\"margin: 0px; padding: 0px;\"><em style=\"margin: 0px; padding: 0px;\">Nitika Gupta</em></strong></p><p style=\"margin: 0.8rem 0px 0px; padding: 0px; font-size: inherit; max-width: 118.4rem;\">\"Yes this course was a good match for me, as the previous topical areas and what was mentioned is exactly where I want to develop my communication skills.\"&nbsp;<strong style=\"margin: 0px; padding: 0px;\"><em style=\"margin: 0px; padding: 0px;\">Anna Keane</em></strong></p><p style=\"margin: 0.8rem 0px 0px; padding: 0px; font-size: inherit; max-width: 118.4rem;\">\"TJ Walker knows exactly what he\'s talking about, and I love the way he passes the message.\"&nbsp;<strong style=\"margin: 0px; padding: 0px;\"><em style=\"margin: 0px; padding: 0px;\">Cesar Adolfo Correa Urbina</em></strong></p><p style=\"margin: 0.8rem 0px 0px; padding: 0px; font-size: inherit; max-width: 118.4rem;\">\"This course is a gem! TJ Walker is the best presenter I\'ve ever seen, and he shows you what he knows. He doesn\'t tell you theoretical stuff teachers learn and teach but haven\'t experienced. I completely see that TJ brings you everything he learned in his 30 years of experience. Sure: this course is long and repetitive. But that is the best. All the information of how to be a great presenter is not only in my mind, but in my blood. I feel much more confident about presenting in any situation after doing this course. I recommend it.\"<strong style=\"margin: 0px; padding: 0px;\"><em style=\"margin: 0px; padding: 0px;\">&nbsp;Bruno Bastos</em></strong></p></div><div class=\"styles--audience--2pZ0S\" data-purpose=\"target-audience\" style=\"margin: 3.2rem 0px 0px; padding: 0px;\"><h2 class=\"udlite-heading-xl styles--audience__title--1Sob_\" style=\"margin-right: 0px; margin-bottom: 1.6rem; margin-left: 0px; padding: 0px; font-size: 2.4rem; font-weight: 700; max-width: 118.4rem; font-family: &quot;sf pro display&quot;, -apple-system, BlinkMacSystemFont, Ro